import React from 'react';
import '../styles/neomorph.css';

const VirtualPet = ({ petHealth }) => {
    const petStage = petHealth === 100 ? 'healthy' : petHealth >= 50 ? 'neutral' : 'sick';

    return (
        <div className="neomorph-card" style={{ textAlign: 'center' }}>
            <h3>Tu Mascota Virtual</h3>
            <img src={`/images/${petStage}.png`} alt="Pet Health" style={{ height: '100px' }} />
            <p>Salud: {petHealth}%</p>
        </div>
    );
};

export default VirtualPet;
